&quot;REAL LIFE&quot; Web Comic

&quot;Real Life&quot; (reallifecomics.com) by Greg Dean is a Web comic loosely based around the real lives of Greg and his friends.  Of course, the qualifier &quot;loosely&quot; is important.  While some comics feature verbatim quotes of actual conversations, others feature completely ludicrous events including time travel and mecha combat.  The characters tend to be rather heavily exaggerated versions of their real-life selves, and live lives very much their own.  &quot;Real Life&quot; focuses on humor related to video games, science fiction, and other &quot;geeky&quot; interests.  The characters are known for often breaking the fourth wall.  The comic has also been a major spreader of various memes such as &quot;Fuego,&quot; &quot;ShirtNinja&quot; and &quot;The Game.&quot;

This torrent collects &quot;Real Life&quot; comics from the strip's debut in 1999 through the end of 2014.  The comics are compiled into a set of CBR files, one for each year
